import React from 'react'
import { useAuth0 } from "@auth0/auth0-react"
import CalendarHeatmap from 'react-calendar-heatmap'
import 'react-calendar-heatmap/dist/styles.css'

const Profile = () => {
  const { user } = useAuth0()

  return (
    <div className="profile-container">
      <div className="row gutters">
        <div className="col-xl-3 col-lg-3 col-md-12 col-sm-12 col-12">
          <div className="card h-100">
            <div className="card-body">
              <div className="account-settings">
                <div className="user-profile">
                  <div className="user-avatar">
                    {/* <img src={user.picture} alt="profile-pic"/> */}
                  </div>
                  {/* <h5 className="user-name">{user.nickname}</h5>
                  <h6 className="user-email">{user.email}</h6> */}
                </div>
                <div className="about">
                  <h5>Search execution today</h5>
                  <p>number</p>
                </div>
              </div>
            </div>
          </div>
          </div>
          <div className="col-xl-9 col-lg-9 col-md-12 col-sm-12 col-12">
          <div className="card h-100">
            <div className="card-body">
              <div className="row gutters">
                <div className="col-xl-12 col-lg-12 col-md-12 col-sm-12 col-12">
                  <h6 className="mb-2 text-primary">Personal Details</h6>
                </div>
                <div className="col-xl-6 col-lg-6 col-md-6 col-sm-6 col-12">
                  <div className="form-group">
                    <label htmlFor="fullName">Full Name</label>
                    {/* <input type="text" className="form-control" value={user.name} readonly/> */}
                  </div>
                </div>
                <div className="col-xl-6 col-lg-6 col-md-6 col-sm-6 col-12">
                  <div className="form-group">
                    <label htmlFor="eMail">Email</label>
                    {/* <input type="email" className="form-control" value={user.email} readonly/> */}
                  </div>
                </div>
              </div>
              <div className="row gutters">
                <div className="col-xl-12 col-lg-12 col-md-12 col-sm-12 col-12">
                  <h6 className="mt-3 mb-2 text-primary">Searches in this year</h6>
                </div>
                  <CalendarHeatmap
                    startDate={new Date('2021-01-01')}
                    endDate={new Date('2022-01-01')}
                    values={[
                      { date: '2021-07-01', count: 1 },
                      { date: '2021-08-22', count: 19 },
                      { date: '2021-09-30', count: 3 },
                      { date: '2021-06-30', count: 3 },

                    ]}

                    classForValue={(value) => {
                      if (!value) {
                        return 'color-empty';
                      }
                      else if (value.count < 5){
                        return `color-scale-1`
                      }
                      else if (value.count > 5){
                        return `color-scale-2`
                      }
                      else if (value.count > 10 && value.count < 20){
                        return `color-scale-3`
                      }
                      else{
                        return `color-scale-4`
                      }
                    }}
                  />
               
              </div>
              
            </div>
          </div>
        </div>
      </div>
    </div>
    )
}

export default Profile
